import React, { useState, useEffect } from "react";
import { Footer, Header } from "../components";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faTrash } from "@fortawesome/free-solid-svg-icons";

const Cart = () => {
  const [cartItems, setCartItems] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    // Lấy idUser từ cookie
    const userId = document.cookie.replace(
      /(?:(?:^|.*;\s*)userId\s*=\s*([^;]*).*$)|^.*$/,
      "$1"
    );

    // Gọi API để lấy thông tin cart của user
    fetch(`http://localhost:8080/cart/${userId}`)
      .then((response) => response.json())
      .then((data) => {
        setCartItems(data.data);
        setIsLoading(false);
      })
      .catch((error) => console.error("Error fetching cart items:", error));
  }, []);

  const handleRemoveItem = (idCart) => {
    // Gọi API để xóa item khỏi cart
    fetch(`http://localhost:8080/cart/${idCart}`, {
      method: "DELETE",
    })
      .then((response) => response.json())
      .then((data) => {
        if (data.statusCode === 200) {
          // Xóa item khỏi state
          setCartItems((prevItems) =>
            prevItems.filter((item) => item.idCart !== idCart)
          );
        } else {
          console.error("Failed to remove item from cart:", data.message);
        }
      })
      .catch((error) => console.error("Error removing item from cart:", error));
  };

  const EmptyCart = () => {
    return (
      <div className="container">
        <div className="row">
          <div className="col-md-12 py-5 bg-light text-center">
            <h4 className="p-3 display-5">Your Cart is Empty</h4>
            <Link to="/" className="btn btn-outline-dark mx-4">
              <i className="fa fa-arrow-left"></i> Continue Shopping
            </Link>
          </div>
        </div>
      </div>
    );
  };

  const ShowCart = () => {
    return (
      <div className="row">
        {/* Hiển thị thông tin từng item trong cart */}
        {cartItems.map((item) => (
          <div key={item.idCart} className="col-md-4">
            <div className="card mb-4">
              <div className="card-body">
                <img
                  src={item.imageWorkshop}
                  alt={item.nameWorkshop}
                  className="img-fluid mb-2"
                />
                <h5 className="card-title">{item.nameWorkshop}</h5>
                <p className="card-text">
                  <strong>Price:</strong> ${item.priceTicket}
                </p>
                <p className="card-text">
                  <strong>Quantity:</strong> {item.quantityTicket}
                </p>
                <button
                  className="btn btn-danger"
                  onClick={() => handleRemoveItem(item.idCart)}
                >
                  <FontAwesomeIcon icon={faTrash} /> Remove
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>
    );
  };

  return (
    <>
      <Header />
      <div className="container my-3 py-3">
        <h1 className="text-center">Cart</h1>
        <hr />
        {isLoading ? (
          <p>Loading...</p>
        ) : cartItems.length > 0 ? (
          <ShowCart />
        ) : (
          <EmptyCart />
        )}
      </div>
      <Footer />
    </>
  );
};

export default Cart;
